import React from "react";
import Layout from "../../components/shared/Layout/Layout";

const OrganisationList = () => {
  return (
    <Layout>
      <h2 className="mt-5 mb-4 fw-bold text-primary font-sofias">
        Organisation - List
      </h2>
      <hr />
    </Layout>
  );
};

export default OrganisationList;
